import React from 'react';
import arrow from '../image/arrow food.png'
import '../css/food.css';
import mushroom from '../image/mushroom.png';
import tofu from '../image/tofu.png';
import cabage from '../image/cabage.png';
import noodle from '../image/noodle.png';


class Food extends React.Component{
  state={
    content : "เมนูอาหารจากเห็ด"
  }
  Changemushroom=()=>{
    this.setState({content : "อาหารจากเห็ด" })
  }
  Changetofu=()=>{
    this.setState({content : "อาหารจากเต้าหู้" })
  }

Changecabage=()=>{
  this.setState({content : "อาหารจากกะหล่ำ" })
}

Changenoodle=()=>{
  this.setState({content : "อาหารจากเส้น" })
}
render(){
    return (
      <div className="Food">
        <div className="foodtopic">FOOD</div>
        <div className="foodpic">
        <div className="mushroom"><div className="thishover"><img src={mushroom} width='250pt'onClick={this.Changemushroom}/></div> <br></br> <img src={arrow} width='50pt'/></div>
        <div className="tofu"><div className="thishover"><img src={tofu} width='250pt' onClick={this.Changetofu}/></div><br></br> <img src={arrow} width='50pt'/></div>
        <div className="cabage"><div className="thishover"><img src={cabage} width='250pt' onClick={this.Changecabage}/></div><br></br> <img src={arrow} width='50pt'/></div>
        <div className="noodle"><div className="thishover"><img src={noodle} width='250pt' onClick={this.Changenoodle}/></div><br></br> <img src={arrow} width='50pt'/></div>
      </div>
      <div className="foodcontent"><p>{this.state.content}</p>
        </div>
      </div>
    )
}
}
export default Food;
